import React, {Component} from 'react'

class Sidebar extends Component{
    render(){
        return(
            <List disablePadding dense>
                <ListItem button>
                    <ListItemText>Seokwon Choi</ListItemText>
                </ListItem>
                <ListItem button>
                    <ListItemText>Kevin Huh</ListItemText>
                </ListItem>
                <ListItem button>
                    <ListItemText>Dorothea Schaan</ListItemText>
                </ListItem>
            </List>
        )
    }
}
export default Sidebar
